selector_to_html = {"a[href=\"#vurder-modellens-praediktive-vaerdi\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">25.8.5. </span>Vurd\u00e9r modellens pr\u00e6diktive v\u00e6rdi<a class=\"headerlink\" href=\"#vurder-modellens-praediktive-vaerdi\" title=\"Permalink til denne overskrift\">#</a></h2><p>Afslutningsvis, b\u00f8r du vurdere, om modellen giver mening og overveje, hvad dens begr\u00e6nsninger er. Det er en sund \u00f8velse at forst\u00e5, hvad din model kan. Din model b\u00f8r selvf\u00f8lgelig v\u00e6re dit bedste bud p\u00e5 en model for dit data. Men, giver den ogs\u00e5 mening over tid? Hvad hvis du indsamlede mere data, ville det s\u00e5 stadig v\u00e6re den samme model, du havde g\u00e5et med? Kan du komme i tanke om begr\u00e6nsninger ved din model? Hvis du bruger en line\u00e6r model, giver det s\u00e5 mening, at din data skulle udvikle sig line\u00e6rt?</p><p>Det er s\u00e5danne overvejelser, der er med til at vurdere modellens pr\u00e6diktive v\u00e6rdi. Det kan v\u00e6re en sv\u00e6r \u00f8velse, men meget indsigtsfuld!</p>", "a[href=\"#matematisk-modellering-i\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">25.8. </span>Matematisk modellering I<a class=\"headerlink\" href=\"#matematisk-modellering-i\" title=\"Permalink til denne overskrift\">#</a></h1><p>En disciplin, der foretages i mange sammenh\u00e6nge, er matematisk modellering. Som vi ogs\u00e5 introducerede dette emne med, s\u00e5 handler matematisk modellering om at bruge den data, som du har tilg\u00e6ngelig, til at sige noget pr\u00e6diktivt. Det kan b\u00e5de v\u00e6re at komme med bud p\u00e5, hvordan din data kunne udvikle sig uden for det omr\u00e5de, som du har observeret. For eksempel, hvordan udvikler befolkningen sig de n\u00e6ste par \u00e5r? Det kan ogs\u00e5 v\u00e6re noget, der er afledt af den model, som du har estimeret. For eksempel, hvilke faktorer der har st\u00f8rst indflydelse p\u00e5 udviklingen, eller hvordan din model vil reagere, hvis visse parametre \u00e6ndres. Dette g\u00f8r det muligt at forst\u00e5 sammenh\u00e6nge, fors\u00f8ge at forudsige fremtidige tendenser og tr\u00e6ffe mere informerede beslutninger baseret p\u00e5 modellens resultater.</p><p>S\u00e5 skal du lave en matematisk model, s\u00e5 kan det v\u00e6re sundt at have overvejet f\u00f8lgende elementer.</p>", "a[href=\"#handtering-af-outliers-og-manglende-vaerdier\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">25.8.2. </span>H\u00e5ndtering af outliers og manglende v\u00e6rdier<a class=\"headerlink\" href=\"#handtering-af-outliers-og-manglende-vaerdier\" title=\"Permalink til denne overskrift\">#</a></h2><p>I din diskriptive statistik vil du ogs\u00e5 se, hvis du mangler data eller har outliers. Disse observationer skal h\u00e5ndteres. I de fleste sammenh\u00e6nge ignoreres hele datapunktet. Der findes dog andre m\u00e5der at h\u00e5ndtere dem p\u00e5. Pr\u00f8v at overveje f\u00f8lgende:</p>", "a[href=\"#undersog-din-data\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">25.8.1. </span>Unders\u00f8g din data<a class=\"headerlink\" href=\"#undersog-din-data\" title=\"Permalink til denne overskrift\">#</a></h2><p>Hvordan ser din data ud? Det er vigtigt, at du forst\u00e5r dit data, inden du laver en model. Det kan derfor v\u00e6re sundt, at du laver deskriptiv statistisk p\u00e5 dit data, b\u00e5de din forklarende variabel (<span class=\"math notranslate nohighlight\">\\(x\\)</span>) og din responsvariabel (<span class=\"math notranslate nohighlight\">\\(y\\)</span>).</p><p>Har du f\u00e5et en god fornemmelse for, hvordan dine variabler ser ud individuelt, s\u00e5 er det tid til at kigge p\u00e5, hvordan de opf\u00f8rer sig i forhold til hinanden. Ser vi en tydelig sammenh\u00e6ng? Er de korrelerede? Det er oftest ikke nok kun at beregne korrelationskoefficienten for at kunne vurdere en god model. For eksempel, en positiv korrelation kan sagtens opst\u00e5 for data, der udvikler sig eksponentielt. Her har vi brug for at se dataets udvikling visuelt. Unders\u00f8gelser i et scatterplot kan v\u00e6re meget indsigtsfulde. M\u00e5ske, du ogs\u00e5 har brug for at pr\u00f8ve at plotte dine datapunkter i et enkelt- og/eller dobbeltlogaritmisk koordinatsystem.</p>", "a[href=\"#evaluer-modellen-med-forklaringsgraden-og-residualerne\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">25.8.4. </span>Evalu\u00e9r modellen med forklaringsgraden og residualerne<a class=\"headerlink\" href=\"#evaluer-modellen-med-forklaringsgraden-og-residualerne\" title=\"Permalink til denne overskrift\">#</a></h2><p>Som et led i at finde en passende model, skal residualerne vurderes. Opf\u00f8rer de sig p\u00e6nt?</p>", "a[href=\"#find-den-bedst-passende-model\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">25.8.3. </span>Find den bedst passende model<a class=\"headerlink\" href=\"#find-den-bedst-passende-model\" title=\"Permalink til denne overskrift\">#</a></h2><p>Vi har nu f\u00e5et en forst\u00e5else af data, og kan p\u00e5 baggrund af den indsigt give et bud p\u00e5 hvilken model, der kunne v\u00e6re oplagt.</p><p>Ser vi en line\u00e6r tendens i et almindeligt scatterplot, s\u00e5 kan en simpel line\u00e6r regressionsmodel v\u00e6re et godt bud p\u00e5 en model. Er den line\u00e6re tendens synlig i et enkeltlogaritmisk koordinatsystem, s\u00e5 er en eksponentiel model et godt bud. Hvis det er i et dobbeltlogaritmisk koordinatsystem, s\u00e5 en potens model.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
